import React from 'react';
import User from '../components/Users';

const Users = (props) => {
    return(
        <div>
            {
                this.state.users.map( (user, i) => {
                    return <User 
                    name={this.state.users[i].name} 
                    username={this.state.users[i].username}
                    email={this.state.users[i].email}
                    /> 
                })
            }
        </div>
    );
}

export default Users;
